import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Box, Typography, Button, Grid, CircularProgress, Container, Paper } from '@mui/material';
import PersonIcon from '@mui/icons-material/Person';
import axios from 'axios';

const seventiesColors = [
  '#ff9800', // arancione
  '#ffb300', // giallo caldo
  '#795548', // marrone
  '#fff8e1', // crema
  '#d84315', // rosso mattone
];

function StudentArchive() {
  const [students, setStudents] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();
  const apiUrl = process.env.REACT_APP_API_URL;

  useEffect(() => {
    axios.get(`${apiUrl}/api/students`, {
      headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
    })
      .then(res => setStudents(res.data))
      .finally(() => setLoading(false));
  }, []);

  const getLessons = (student) =>
    student && student.tesserini && Array.isArray(student.tesserini) && student.tesserini.length > 0 && Array.isArray(student.tesserini[student.tesserini.length - 1].lessons)
      ? student.tesserini[student.tesserini.length - 1].lessons
      : [];

  return (
    <Box sx={{
      minHeight: '100vh',
      bgcolor: '#232323',
      p: 4,
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
    }}>
      {/* Titolo rimosso per look palestra */}
      {loading ? (
        <Box sx={{ display: 'flex', justifyContent: 'center', mt: 8 }}>
          <CircularProgress color="warning" />
        </Box>
      ) : (
        <Container maxWidth="lg" sx={{ mt: 4, height: '80vh', overflow: 'hidden', display: 'flex', flexDirection: 'column' }}>
          <Box sx={{
            bgcolor: '#232323',
            borderRadius: 4,
            p: 4,
            boxShadow: '0 8px 32px #000a',
            border: '4px solid #d32f2f',
            background: 'linear-gradient(135deg, #232323 0%, #444 100%)',
            flex: 1,
            overflowY: 'auto',
          }}>
            <Grid container spacing={3}>
              {students.map((student, idx) => (
                <Grid item xs={12} sm={6} md={4} key={student._id}>
                  <Paper
                    elevation={4}
                    sx={{
                      bgcolor: '#181818',
                      borderRadius: 10,
                      boxShadow: '0 4px 24px #000a',
                      p: 3,
                      display: 'flex',
                      flexDirection: 'column',
                      alignItems: 'center',
                      border: '3px solid #1976d2',
                      minHeight: 220,
                      position: 'relative',
                      transition: 'transform 0.2s, box-shadow 0.2s',
                      '&:hover': {
                        transform: 'scale(1.04)',
                        boxShadow: '0 8px 32px #1976d2aa',
                        borderColor: '#fff',
                      },
                    }}
                  >
                    <PersonIcon sx={{ fontSize: 48, color: '#1976d2', mb: 1, textShadow: '0 2px 8px #fff8' }} />
                    <Typography variant="h5" sx={{
                      fontFamily: 'Personal Services, Arial, sans-serif',
                      fontWeight: 900,
                      color: '#fff',
                      textShadow: '0 2px 8px #1976d2',
                      mb: 1,
                      letterSpacing: 2,
                      textTransform: 'uppercase',
                      fontSize: 24,
                      borderBottom: '2px solid #1976d2',
                      pb: 1,
                      width: '100%',
                      textAlign: 'center',
                    }}>
                      {student.name}
                    </Typography>
                    <Typography variant="body1" sx={{ color: '#90A4AE', mb: 1, fontWeight: 700, fontFamily: 'Personal Services, monospace', fontSize: 16 }}>
                      {student.telefono}
                    </Typography>
                    <Typography variant="body2" sx={{ color: '#1976d2', mb: 2, fontWeight: 900, fontSize: 16, letterSpacing: 1 }}>
                      Lezioni: {getLessons(student).filter(l => l.isUsed).length} / {getLessons(student).length}
                    </Typography>
                    <Button
                      variant="contained"
                      sx={{ bgcolor: '#1976d2', color: '#fff', fontWeight: 900, borderRadius: 2, fontFamily: 'Personal Services, Arial, sans-serif', mt: 1, px: 3, boxShadow: '0 2px 8px #1976d244', letterSpacing: 2, '&:hover': { bgcolor: '#1565c0', color: '#fff' } }}
                      onClick={() => navigate(`/student/${student._id}`)}
                    >
                      VEDI
                    </Button>
                  </Paper>
                </Grid>
              ))}
            </Grid>
          </Box>
        </Container>
      )}
    </Box>
  );
}

export default StudentArchive;
